export class Task {
    id : any;
    description : string = '';
    category_id : any;
    parent_task : any;
    dead_line : any;

    constructor(id: number, description: string, category_id : any, salary: number) {
        this.id = id;
        this.description = description;
        this.category_id = category_id;
        this.salary = salary;
      }
}
